INSERT INTO `migu_tv_service` VALUES ('1', '运行时配置getConfig', '2.0', 'tvGetConfig', '{\"appid\":\"A0001\",\"channel\":\"200BBB\",\"uid\":\"uid\",\"osid\":\"tv\",\"version\":\"1.0.8\",\"protocolver\":\"protocolver\",\"imsi\":\"imsi\",\"imei\":\"imei\",\"stbid\":\"stbid\",\"apn\":\"wifi\",\"ua\":\"tv\",\"mobilephone\":\"18782947838\",\"mac\":\"0000000001\",\"osid\":\"Android_TV\"}', '接口说明：程序启动时调用，获取一些配置信息、判断是否需要进行升级、记录启动日志。激活用户信息，获取用户唯一标示。 1、判断客户端渠道是否有特殊升级配置，如果有，则使用特殊升级配置；如果没有，则使用默认升级配置     2、如果客户端版本在某个配置的升级区间内，则返回该区间的升级配置信息：         updatetype=1（自主升级）或2（强制升级），updateinfo=升级提示语         updateversion=升级到的版本编号，downloadurl=升级包下载地址     3、如果客户端版本不在任何配置的升级区间内，则返回updatetype=0(不升级)，其他字段为空 需要在后台配置客户端版本及版本', '1');
