INSERT INTO `migu_tv_service` VALUES ('8', '歌曲栏目列表getSongsByClm ', '2.0', 'tvGetSongsByClm', '{\"protocolver\":\"2.0.0\",\"programno\":\"76a4df2da23843de9f8ece5c67d4ebd9\",\"start\":1,\"count\":10,\"width\":\"222\",\"height\":\"222\"}', '接口说明：获取歌曲栏目中的歌曲列表。当没有取到资源时候，依然返回成功，只是返回的结果为空。\r\n该接口只返回歌曲的基本信息，下载地址等由下载接口返回，歌单歌曲顺序由后台管理系统配置。\r\n接口缓存：是', '1');
INSERT INTO `migu_tv_service` VALUES ('9', '歌手栏目列表getSingersByClm', '2.0', 'tvGetSingersByClm', '{\"protocolver\":\"2.0.0\",\"programno\":\"0\",\"signinfo\":\"W\",\"start\":1,\"count\":10}', '按照关键词搜索，获取歌手栏目中的歌手列表，返回结果按歌手点唱次数倒序。当没有取到作品时候，依然返回成功，只是返回的结果为空。栏目编号\r\n0：全部歌手列表\r\n1：男歌手\r\n2：女歌手 \r\n3：乐队组合\r\n', '1');
INSERT INTO `migu_tv_service` VALUES ('10', '子栏目列表getColumnByNo', '2.0', 'tvGetColumnByNo', '{\"protocolver\":\"2.0.0\",\"programno\":\"0\",\"start\":1,\"count\":10,\"channel\":\"0146585\"}', '获取栏目的子栏目列表。返回结果按照序号排列，序号在后台歌单管理中配置。栏目支持渠道号可在后台管理系统配置。', '1');
INSERT INTO `migu_tv_service` VALUES ('11', '发现页面标签列表getFoundTags', '2.0', 'tvGetFoundTags', '{\"appid\":\"A0001\",\"uid\":\"uid\",\"osid\":\"tv\",\"version\":\"1.0.8\",\"protocolver\":\"protocolver\",\"imsi\":\"imsi\",\"imei\":\"imei\",\"stbid\":\"stbid\",\"apn\":\"wifi\",\"ua\":\"tv\",\"accountid\":\"77f31774-b187-49e5-9187-3ae1b10bbd8a\",\"mobilephone\":\"18782947838\"}', '获取发现页面标签名列表，列表顺序为：1个咪咕推荐+前4个热门标签+前4个推荐标签（与手机端主页一致），其中热门标签与推荐标签的顺序由后台标签管理配置。', '1');
INSERT INTO `migu_tv_service` VALUES ('12', '获取歌曲列表getSongsByMuliType', '2.0', 'tvGetSongsByMuliType', '{\"protocolver\":\"2.0.0\",\"signtype\":\"1\",\"signinfo\":\"W\",\"start\":1,\"count\":10}', '获取歌曲信息列表。该接口返回歌曲的详细信息，返回结果按点唱次数倒序排列。其中，即便搜索的是歌手，也是返回歌手的所有歌曲。（该接口使用接口缓存策略，因此返回的歌曲点唱次数不是实时数据，准确数据可由获取歌曲详情接口获得） 接口搜索方式说明：模糊搜索，但只匹配以搜索关键字开头的数据信息，其中，signtype 为2时，与歌曲名匹配的数据在前，与歌手名匹配的数据在后，signtype 为4时，与歌曲首字母匹配的数据在前，与歌手名匹配的数据在后。', '1');
INSERT INTO `migu_tv_service` VALUES ('13', '获取歌手列表getSingersByCapital', '2.0', 'tvGetSingersByCapital', '{\"protocolver\":\"2.0.0\",\"signinfo\":\"W\",\"start\":1,\"count\":10}', '获取歌手列表信息。该接口用于返回下载地址、更新时间等详细字段。请求个性化推荐歌手及统一歌手时，客户端需进行返回结果list与toplist的去重。', '1');
INSERT INTO `migu_tv_service` VALUES ('14', '获取推荐歌曲列表getRecommendSongs', '2.0', 'tvGetRecommendSongs', '{\"protocolver\":\"2.0.0\",\"toplist\":[\"你的样子\"],\"start\":1,\"count\":10}', '获取推荐歌曲信息列表，由个性化推荐歌曲toplist和统一推荐歌曲list两部分组成返回列表。个性化推荐歌曲：客户端根据历史点歌记录传歌手名（toplist），后台随机抽取这些歌手点唱次数最高的5首歌曲中的2首（不足2首则有多少返回多少），作为toplist返回结果。统一推荐歌曲：list返回所有歌曲中点唱次数从高到低的歌曲列表。客户端需要对list与toplist的结果去重。', '1');
